import React from 'react';
import './styles.css';

const topPart = {
    margin: "100px",
    height: "40vh",
    width: "100%",
}

const headline = {
    fontSize: "50px",
}

const subheader = {
    fontSize: "25px",
}

export default function Frontpage() {
    return (
        <div className="Body">
            <div style={topPart}>
                <h1 className="display-3">Hello, I'm <strong className="text-danger">Nikolaj Jensen</strong>.</h1>
                <i style={subheader}>I design and code awesome stuff, and I love what I do!</i>
                <p className="p-5">
                    <button className="btn btn-outline-dark btn-lg" type="button" href="#carouselExampleControls">See my work</button>
                </p>
            </div>
        </div>

    )
}
